import './App.css';
import {
  HashRouter as Router,
  Routes, 
  Route
} from 'react-router-dom';
import HomePage from './Homepage';
import TaskManager from './TaskManager';

function App() {
  return (
    <Router>
    <Routes> 
        <Route
          path="/Homepage"
          element={<HomePage />} 
        />
        <Route
          path="/"
          element={<HomePage />} 
        />
        <Route
          path="/TaskManager"
          element={<TaskManager />} 
        />
      </Routes>
      </Router>
  );
}

export default App;
